            const timerCodeGraph = setTimeout(() => {
                setShowCodeGraph(true)
            }, initialDelay)

            const timerCodeSearchPalette = setTimeout(() => {
                setShowCodeSearchPalette(true)
            }, initialDelay + delayBetweenComponents)

